import './App.css';
import {Row,Col,Container} from 'reactstrap';
import Navbar1 from './Navbar1';
import "bootstrap/dist/css/bootstrap.min.css";
import Component_2 from './Component_2';
import Component_3 from './Component_3';


function App() {
  return (
    <div >
      <Row>
      <Navbar1/>
      </Row>
      <Row>
      <Component_2/>
      </Row>
      <Row>
        <Component_3/>
      </Row>



    </div>
  );
}

export default App;
